import React, { useState } from 'react';
import img0 from "../../imgs/img0.png";
import img1 from "../../imgs/img1.png";
import img2 from "../../imgs/img2.png"

const collageType_DATA = ["collage-0", "collage-1", "collage-2", "collage-3", "collage-4"]
const img_DATA = [img0, img1, img2]



const ImgCollage = (props) => {
    const [collageType, setCollageType] = useState(0);
    return ( 
        <div className={`imgCollage ${collageType_DATA[collageType]}`}> 
            <div className="imgBox">
                <img className="imgBox-img" src={img_DATA[0]}>

                </img>
            </div>
            <div className="imgBox">
                <img className="imgBox-img" src={img_DATA[1]}>

                </img>
            </div>
            <div className="imgBox">
                <img className="imgBox-img" src={img_DATA[2]}>

                </img>
            </div>
        </div> 
    );
}

export default ImgCollage;
